import React from "react";

function App() {
  function getName(name) {
    return name.firstName + " " + name.lastName.toLowerCase();
  }

  const myname = {
    firstName: "Bob",
    lastName: "Dylan",
  };

  const element = <h1>This is {getName(myname)}!</h1>;

  React.render(element, document.body);
}

export default App;
